import React from 'react';
import logo from '../src/logo.png';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Joke from './Components/Joke';
import './Components/joke.css';
import background2 from './background2.jpeg';

function App() {
  return (
    <div className="App" style={{ backgroundImage: `url(${background2})`, backgroundSize: 'cover', minHeight: '100vh' }}>
      <p>
        <nav className="navbar navbar-light bg-dark">
          <a className="navbar-brand" href="#">
            <img src={logo} width="30" height="30" alt="" />
          </a>
        </nav>
        <h1 style={{ backgroundColor: "#c8c81ab5", padding: '10px' }}>Jokes Generator using Jokes API</h1>
      </p>
      <Joke />
    </div>
  );
}

export default App;
